import React, {Component} from "react"; 
import "./Home.css";
import Miscreant from "./images/miscreant.mp4"

class Home extends Component {
    render(){
        return (
            <div className="Home">
                <video className="Home-video" autoPlay loop muted>
                    <source src={Miscreant} type="video/mp4" />
                </video>
            </div>
        )
    }
}

export default Home;
